import './App.css';
import React, { useEffect, useState} from 'react';
import Axios from 'axios';

function Todolist({todos}) {

  useEffect(() => {
    fetchTodos();
  }, []);

  return (
    <div>
      <div className="ListOfTodos">
        {todos.map((todo) => (
          <p key={todo.id}> {todo.id}{todo.title}</p>
        ))}
      </div>
    </div>
  );
}

export default Todolist;
